import { useState } from "react";
import React from "react";
import { useHistory } from "react-router-dom";
import axios from "axios";
import {
  Card,
  CardBody,
  CardHeader,
  CardFooter,
  Form,
  Container,
  Col,
  Input,
  InputGroup,
  InputGroupAddon,
  InputGroupText,
  Button,
} from "reactstrap";

import bgImage from "./img/bg";
import nowLogo from "assets/img/now-logo.png";

const serverUrl = process.env.REACT_APP_SERVER_URL;

function Login(props) {
  const [user, setUser] = useState({
    email: "",
    password: "",
  });

const [error, setError] = useState(null);
const [loading, setLoading] = useState(false);

const handleChange = (e) => {
  setUser({ ...user, [e.target.id]: e.target.value });
};

let history = useHistory();

const login = (e) => {
  e.preventDefault();
  setError(null);
  setLoading(true);
  axios
    .post(`${serverUrl}/users/login`, user)
    .then(({ data }) => {
      localStorage.setItem("token", data.token);
      props.setUser(data.user);
      history.push("/");
    })
    .catch((error) => {
      console.log(error);
      setError("Invalid email or password")
    })
    .finally(() => {
      setLoading(false);
    });
};

return (
<>
<div className="content">
  <div className="login-page">
    <Container>
      <Col xs={12} md={8} lg={4} className="ml-auto mr-auto">
        <Form onSubmit={login}>
          <Card className="card-login card-plain">
            <CardHeader>
              <div className="logo-container">
                <img className="loginlogo" src={nowLogo} alt="now-logo" />
              </div>
            </CardHeader>
            <CardBody>
              <InputGroup className="form-group">
                <label>Email address</label>
                <InputGroupAddon addonType="prepend">
                  <InputGroupText>
                    <i className="now-ui-icons users_circle-08" />
                  </InputGroupText>
                </InputGroupAddon>
                  <input 
                     type="email"
                     placeholder="Enter email"
                     className="form-control"
                     onChange={handleChange}
                     id="email"
                     required
                   />
                </InputGroup>
                <InputGroup className="form-group">
                  <InputGroupAddon addonType="prepend">
                    <InputGroupText> <i className="now-ui-icons text_caps-small" /> </InputGroupText>
                  </InputGroupAddon>
                  <input
                     type="password"
                     placeholder="Password"
                     className="form-control"
                     onChange={handleChange}
                     id="password"
                     required
                   />
                </InputGroup>
                {error && <p className="text-danger">{error}</p>}
            </CardBody>
            <CardFooter>
              <Button
                  block
                  color="primary"
                  size="lg"
                  type="submit"
                  className="mb-3 btn-round"
                  disabled={loading} >
                  {loading ? 'Loading...' : 'Sign in'}
              </Button>
              <div className="pull-left">
                <h6> <a href="#pablo" className="link footer-link">Create an account</a> </h6>
              </div>
              <div className="pull-right">
                <h6><a href="#pablo" className="link footer-link">Need help?</a></h6>
              </div>
            </CardFooter>
          </Card>
        </Form>
      </Col>
    </Container>
  </div>
</div>
<div
  className="full-page-background"
  style={{ backgroundImage: "url(" + bgImage + ")" }}
  />
</>
);
}

export default Login;
